INSERT INTO listings (listing_description, listing_review_average, listing_review_total, listing_host_name, listing_host_photo_url, listing_address, listing_space_description, listing_neighborhood_description) VALUE ('open air nest by upscale guppie area', 0, 84, 'Asylum', 'https://s3-us-west-1.amazonaws.com/sdc-pawstel-images/gallery/4.jpeg', 'Playground Street, Berlin, Germany', 'From the outside this house looks old, but wonderful. It has been built with brown bricks and has red brick decorations. Tall, squared windows allow enough light to enter the home and have been added to the house in a fairly asymmetrical pattern.', 'Cast on the lowest point of a forest, the outpost of Pernrith is home to humans lead by Commander Masser. This outpost wasnt built by a forest by accident, as it has hidden tunnels, which is of great importance to the people of Pernrith and its success.' );
INSERT INTO listings (listing_description, listing_review_average, listing_review_total, listing_host_name, listing_host_photo_url, listing_address, listing_space_description, listing_neighborhood_description) VALUE ('open air doghouse in dog park', 3, 26, 'Asylum', 'https://s3-us-west-1.amazonaws.com/sdc-pawstel-images/gallery/14.jpeg', 'Playground Street, Berlin, Germany', 'From the outside this house looks nice and traditional. It has been built with tan stones and has tan stone decorations. Small, half rounded windows add to the overall style of the house and have been added to the house in a very symmetric way.', 'Set on the peak of a wetlands, the township of Gloufry is home to gnomes lead by Director Bimbik. This township wasnt built by a wetlands by accident, as it has ancient burial grounds, which is of great importance to the people of Gloufry and its success.' );
INSERT INTO listings (listing_description, listing_review_average, listing_review_total, listing_host_name, listing_host_photo_url, listing_address, listing_space_description, listing_neighborhood_description) VALUE ('cozy nest in dog park', 2, 35, 'Brave', 'https://s3-us-west-1.amazonaws.com/sdc-pawstel-images/gallery/28.jpeg', 'Pet Street, Accra, Ghana', 'The roof is low, triangular and layered and is covered with wood shingles. One small chimney sits at the side of the house. A few large windows let in just enough light to the rooms below the roof. The house itself is surrounded by a well kept garden, with a grass field and flower patches at the edges of the garden.', 'Cullfield has a damaged economy, which is mainly supported by animal breeding, cooking and wine brewing. But their biggest strengths are deadly archers and weaponsmithing. However, Cullfield lacks people skilled in alchemy.' );
