INSERT INTO listings (listing_description, listing_review_average, listing_review_total, listing_host_name, listing_host_photo_url, listing_address, listing_space_description, listing_neighborhood_description) VALUE ('open air quiet hermit shell by ruff neighborhood', 1, 81, 'Danana', 'https://s3-us-west-1.amazonaws.com/sdc-pawstel-images/gallery/11.jpeg', 'Thriller Street, Tokyo, Japan', 'The roof is low, triangular, but one side is longer than the other and is covered with brown roof tiles. Two small chimneys poke out the center of the roof. Rows of small windows let in plenty of light to the rooms below the roof.The house itself is surrounded by paved ground, with an outdoor eating and relaxing space and various potted plants.', 'Despite its strengths and weaknesses, Pernrith is most likely headed towards a affluent future under the leadership of Commander Masser. But this remains to be seen.' );
INSERT INTO listings (listing_description, listing_review_average, listing_review_total, listing_host_name, listing_host_photo_url, listing_address, listing_space_description, listing_neighborhood_description) VALUE ('brand new doghouse in cowtown', 2, 70, 'Flurry', 'https://s3-us-west-1.amazonaws.com/sdc-pawstel-images/gallery/5.jpeg', 'Doggy Street, Kingston, Jamaica', 'The building is shaped like an L. The extension extends into wooden sunscreens structures circling around half the house.The second floor is the same size as the first, but part of it hangs over the edge of the floor below, creating an overhang on one side and a balcony on the other. This floor has a very different style than the floor below.', 'Pernrith has a flourishing economy, which is mainly supported by tailoring, armorsmithing and thieving. But their biggest strengths are highly skilled thieving and weaponsmithing. However, Pernrith lacks people skilled in crafting.' );
INSERT INTO listings (listing_description, listing_review_average, listing_review_total, listing_host_name, listing_host_photo_url, listing_address, listing_space_description, listing_neighborhood_description) VALUE ('gllamarous lions den close to upscale guppie area', 1, 25, 'Brave', 'https://s3-us-west-1.amazonaws.com/sdc-pawstel-images/gallery/8.jpeg', 'Pet Street, Accra, Ghana', 'The roof is low, triangular and layered and is covered with wood shingles. One small chimney sits at the side of the house. A few large windows let in just enough light to the rooms below the roof. The house itself is surrounded by a well kept garden, with a grass field and flower patches at the edges of the garden.', 'Cullfield has a damaged economy, which is mainly supported by animal breeding, cooking and wine brewing. But their biggest strengths are deadly archers and weaponsmithing. However, Cullfield lacks people skilled in alchemy.' );
